  speed: 1000,
  speedAsDuration: true,
});

const App = () => {

  return (
    <div>
       <HomePage />
    </div>
  );
};

export default App;


<Router>
	<Navbar />
	<Routes>
		<Route exact path='/' exact element={<HomePage />} />
